import { useCallback, useEffect, useMemo, useState } from "react";
import { createSlice, PayloadAction } from "@reduxjs/toolkit";

import { firebase } from "../components/test/firebaseTest/firebaseTest";
import { useRegisterData, useUpdateData, useDelteData } from "../components/test/firebaseTest/DBFetch";

type State = {
    [key: string]: string;
};

const initialState: State = {
    ["test"]: "test",
};

const userModule = createSlice({
    name: "user",
    initialState,
    reducers: {
        Register(state: State, action: PayloadAction<State>) {
            const data = action.payload;

            state = {...state,...data};
            console.log('state');
            console.log(state);
        },

    },
});

export const { Register } = userModule.actions;

export default userModule;
